	"Gender"	VARCHAR(30),
	"Item"	VARCHAR(30),
	"Material"	VARCHAR(30),
	"Max_"	INTEGER,
	"Min_"	INTEGER,
	"Type"	VARCHAR(30),
	"Value_"	DOUBLE
);
DROP TABLE IF EXISTS "Translation";
CREATE TABLE IF NOT EXISTS "Translation" (
	"ID"	VARCHAR NOT NULL UNIQUE,
	"Text"	VARCHAR,
	PRIMARY KEY("ID")
);
DROP TABLE IF EXISTS "TreeLayouts";
CREATE TABLE IF NOT EXISTS "TreeLayouts" (
	"ID"	VARCHAR(30)
);
DROP TABLE IF EXISTS "TreeLayouts_Layout";
CREATE TABLE IF NOT EXISTS "TreeLayouts_Layout" (
	"ID"	VARCHAR(30),
	"FruitPos"	BOOLEAN,
	"Offset"	VARCHAR(11),
	"Rotation"	VARCHAR(30),
	"SpriteID"	VARCHAR(30)
);
DROP TABLE IF EXISTS "Uniform";
CREATE TABLE IF NOT EXISTS "Uniform" (
	"ID"	STRING,
	"Sides"	INTEGER
);
DROP TABLE IF EXISTS "Uniform_Slots";
CREATE TABLE IF NOT EXISTS "Uniform_Slots" (
	"ID"	STRING,
	"Type"	STRING,
	"ItemID"	STRING,
	"MaterialType"	STRING
);
DROP TABLE IF EXISTS "Uniforms";
CREATE TABLE IF NOT EXISTS "Uniforms" (
	"ID"	INTEGER,
	"Name"	STRING,
	"UserDefined"	BOOLEAN
);
DROP TABLE IF EXISTS "Utility";
CREATE TABLE IF NOT EXISTS "Utility" (
	"ID"	VARCHAR(30),
	"Buildable"	BOOLEAN,
	"Item"	STRING
);
DROP TABLE IF EXISTS "v_Items";
CREATE TABLE IF NOT EXISTS "v_Items" (
	"UID"	BIGINT,
	"position"	VARCHAR,
	"spriteID"	BIGINT,
	"itemUID"	INTEGER,
	"materialUID"	INTEGER,
	"itemSID"	VARCHAR,
	"materialSID"	VARCHAR,
	"category"	VARCHAR,
	"group"	VARCHAR,
	"pickedUp"	BOOLEAN,
	"isConstructed"	BOOLEAN,
	"inStockpile"	BIGINT,
	"inJob"	BIGINT,
	"isContainer"	BOOLEAN,
	"inContainer"	BIGINT,
	"madeBy"	BIGINT,
	"quality"	INTEGER,
	"value"	INTEGER,
	"eatValue"	INTEGER,
	"drinkValue"	INTEGER,
	"color"	VARCHAR,
	"hasComponents"	BOOLEAN,
	"componentOf"	BIGINT,
	"isTool"	BOOLEAN,
	"lightIntensity"	INTEGER,
	"stackSize"	INTEGER
);
DROP TABLE IF EXISTS "Words";
CREATE TABLE IF NOT EXISTS "Words" (
	"Word"	VARCHAR(30)
);
DROP TABLE IF EXISTS "Words_ActionNoun";
CREATE TABLE IF NOT EXISTS "Words_ActionNoun" (
	"Plural"	VARCHAR(30),
	"Word"	VARCHAR(30)
);
DROP TABLE IF EXISTS "Words_Adjective";
CREATE TABLE IF NOT EXISTS "Words_Adjective" (
	"Word"	VARCHAR(30)
);
DROP TABLE IF EXISTS "Words_Noun";
CREATE TABLE IF NOT EXISTS "Words_Noun" (
	"Plural"	VARCHAR(30),
	"Word"	VARCHAR(30)
);
DROP TABLE IF EXISTS "Words_Numbers";
CREATE TABLE IF NOT EXISTS "Words_Numbers" (
	"Word"	STRING,
	"Number"	INTEGER
);
DROP TABLE IF EXISTS "Words_Verb";
CREATE TABLE IF NOT EXISTS "Words_Verb" (
	"PastParticiple"	VARCHAR(30),
	"PresentParticiple"	VARCHAR(30),
	"SimplePast"	VARCHAR(30),
	"SimplePresent"	VARCHAR(30),
	"Word"	VARCHAR(30)
);
DROP TABLE IF EXISTS "Workshops";
CREATE TABLE IF NOT EXISTS "Workshops" (
	"ID"	STRING,
	"Crafts"	STRING,
	"GUI"	STRING,
	"InputTile"	STRING,
	"OutputTile"	STRING,
	"Size"	STRING,
	"NoAutoGenerate"	BOOLEAN,
	"Icon"	STRING,
	"Tab"	STRING
);
DROP TABLE IF EXISTS "Workshops_Components";
CREATE TABLE IF NOT EXISTS "Workshops_Components" (
	"ID"	VARCHAR(30),
	"Amount"	DOUBLE,
	"ItemID"	VARCHAR(30),
	"MaterialItem"	VARCHAR(50),
	"Offset"	VARCHAR(11),
	"Required"	VARCHAR(50),
	"Forbidden"	VARCHAR(50),
	"SpriteID"	VARCHAR(30),
	"SpriteID2"	VARCHAR(30),
	"Type"	VARCHAR(30),
	"WallRotation"	VARCHAR(30),
	"IsFloor"	BOOLEAN
);
COMMIT;